import React from "react";
import { useNavigate } from "react-router-dom";

function Login()
{
    let navigate = useNavigate();
    return (
        <div>
        <h1>Login</h1>
        <button onClick={()=>navigate("/signup")}>Signup</button>
        </div>
    );
}

export default Login;
